import * as assert from 'assert';
import * as utils from '../misc/Utils';
import { Have_tx } from "../p2pool/p2p/messages/Have_tx";

describe('Have_tx Test', () => {

    it('should be a list', () => {
        let raw = '04f42353353465061a95ba45b2e969e7e137561e2e4fd9a42c3896df3ae9f7f3ddc8b1cc5888078fa6ec633834b987e49d87cfff6aa22770d9de634ecf5cad00f1fac30d38cf0240cb4d5984c7c04da931fa935aabf1059a11db080a6d11895ec11200f32e51dae4bf33f2e0e8abb46c05e99d86b8e0cb86762002ba237de006b5';
        let dat = Buffer.from(raw, 'hex');
        let txs = Have_tx.fromBuffer(dat).txHashes;
        assert.equal(txs.length, 4);
        assert.equal(Have_tx.fromObject({ txHashes: txs }).toBuffer().toString('hex'), raw);
    })

    // http://bitcoin.stackexchange.com/questions/32765/how-do-i-calculate-the-txid-of-this-raw-transaction
    it('should be reversed', () => {
        let data = '';
        let sha256d = utils.sha256d(Buffer.from(data, 'hex'));
        let txid = utils.hexFromReversedBuffer(sha256d);
        assert.equal(txid, 'a55ab1bc5e9f65b57b1ffdedff16d1d2857f7009179e1d0c8de9e9ecb2fcc59c'); // rpc bytes order
    })

    it('should be 7793', () => {
        let bigdata = '';
        let dat = Buffer.from(bigdata, 'hex');
        let txs = Have_tx.fromBuffer(dat).txHashes;
        assert.equal(txs.length, 7793);
        assert.equal(Have_tx.fromObject({ txHashes: txs}).toBuffer().toString('hex'), bigdata);
    })
});